window.addEventListener('load', (event) => {
        const canvas = document.getElementById("CANVAS")
        const ctx = canvas.getContext('2d');
        //var myFont = new FontFace('myFont', 'url(FontsFree-Net-Radiofb.ttf)');
        var year
        const blueModel = ["rgb(255, 255, 255)", "rgb(202, 52, 248)", "rgb(54, 7, 63)", "rgb(72, 113, 247)"]

        canvas.width = window.innerWidth
        canvas.height = window.innerHeight

        let pw = (canvas.width / 1920) > 1 ? 1 : (canvas.width / 1920)
        let ph = (canvas.height / 947) > 1 ? 1 : (canvas.height / 947)

        let particleArray = new Array();
        let particleArrayTxt = new Array();

        let adjustX = -25
        let adjustY = 100
        let txtAdjustX = 90
            /*if (ph - pw > 0) {
                aspectRatio = aspectRatio * (ph - pw) * 0.85
                txtAdjustX = (250 * pw);
                txtAdjustY = 150 * ph;
            }
            */
        const mouse = {
            x: null,
            y: null,
            radius: 80
        }


        window.addEventListener('mousemove', (event) => {
            mouse.x = event.x;
            mouse.y = event.y;
            //console.log(mouse.x, mouse.y)
        })

        function drawImage(centerShift_x, centerShift_y, rw, rh) {
            let imgWidth = png.width
            let imgHeight = png.height
            const data = ctx.getImageData(centerShift_x, centerShift_y, rw, rh)



            class Particle {
                constructor(x, y, color, size) {
                    this.x = x;
                    this.y = y;
                    this.color = color
                    this.size = size;
                    this.baseX = this.x;
                    this.baseY = this.y;
                    this.density = (Math.random() * 100) + 1;
                }

                draw() {

                    ctx.fillStyle = this.color
                    ctx.beginPath();
                    ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
                    ctx.fill();

                }
                update() {
                    let dx = mouse.x - this.x;
                    let dy = mouse.y - this.y;
                    let distance = Math.sqrt(dx * dx + dy * dy);
                    let forceDirectionX = dx / distance;
                    let forceDirectionY = dy / distance;
                    let maxDistance = mouse.radius;
                    let force = (maxDistance - distance) / maxDistance;
                    let directionX = forceDirectionX * force * this.density;
                    let directionY = forceDirectionY * force * this.density;
                    if (distance < mouse.radius) {
                        this.x -= directionX;
                        this.y -= directionY;

                    } else {
                        if (this.x != this.baseX) {
                            let dx = this.x - this.baseX;
                            this.x -= dx / 10;
                        }
                        if (this.y != this.baseY) {
                            let dy = this.y - this.baseY;
                            this.y -= dy / 10
                        }

                    }
                }

            }

            function init() {
                let ic = 2;
                let size = 1
                if (pw > 0.3) {
                    ic = 4
                    size = 2
                }

                if (pw > 0.8) {
                    ic = 6
                    size = 3
                }

                particleArray = []
                for (let y = 0, y2 = data.height; y < y2; y += ic) {
                    for (let x = 0, x2 = data.width; x < x2; x += ic) {
                        if (data.data[
                                (y * 4 * data.width) +
                                (x * 4)
                            ] > 2) {
                            let positionX = x + adjustX;
                            let positionY = y + adjustY;
                            let color = `rgb(${data.data[y * 4 * data.width + (x * 4)]},${data.data[y * 4 * data.width + (x * 4) + 1]},${data.data[y * 4 * data.width + (x * 4) + 2]})`

                            particleArray.push(
                                new Particle(positionX, positionY, color, size)
                            )
                        }
                    }
                }
                particleArrayTxt = []
                for (let y = 0, y2 = year.height; y < y2; y++) {
                    for (let x = 0, x2 = year.width; x < x2; x++) {

                        if (year.data[
                                (y * 4 * year.width) +
                                (x * 4) + 3
                            ] > 200) {
                            let positionX = (x + txtAdjustX) * 5 * pw;
                            let positionY = ((y) * 5 * pw) + rh + (5 / pw);
                            let color = blueModel[Math.round(Math.random() * blueModel.length)];



                            particleArrayTxt.push(
                                new Particle(positionX, positionY, color, 2)
                            )
                        }
                    }
                }


            }
            console.log(particleArrayTxt)
            init();

            function animate() {
                ctx.clearRect(0, 0, canvas.width, canvas.height)
                for (let p of particleArray) {
                    p.draw();
                    p.update();
                }
                for (let p of particleArrayTxt) {
                    p.draw();
                    p.update();
                }
                //connnect()
                requestAnimationFrame(animate)

            }
            animate();

            function connnect() {
                for (let a = 0; a < particleArray.length; a++) {
                    for (let b = a; b < particleArray.length; b++) {
                        let dx = particleArray[a].x - particleArray[b].x;
                        let dy = particleArray[a].y - particleArray[b].y;
                        let distance = Math.sqrt(dx * dx + dy * dy);
                        if (distance < 50) {
                            ctx.strokeStyle = "white";
                            ctx.lineWidht = 2;
                            ctx.beginPath();
                            ctx.moveTo(particleArray[a].x, particleArray[a].y)
                            ctx.lineTo(particleArray[b].x, particleArray[b].y)
                            ctx.stroke()
                        }
                    }

                }
            }
        }
        const png = new Image();
        png.src = "data:image/png;base64,";



        // myFont.load().then(function(font) {
        //  document.fonts.add(font);
        //console.log('Font loaded');
        //ctx.fillStyle = "white"
        // ctx.font = "50px myFont"; // set font
        //ctx.textAlign = "center"; // center text
        //ctx.fillText("2022", 100, 40); // draw centered text
        year = ctx.getImageData(0, 0, 200, 100)
        let obj = drawImageScaled(png, ctx)
        drawImage(obj.centerShift_x, obj.centerShift_y, obj.rw, obj.rh);
        //  });

        console.log(year)
    })
    //https://stackoverflow.com/questions/23104582/scaling-an-image-to-fit-on-canvas
function drawImageScaled(img, ctx) {
    var canvas = ctx.canvas;
    var hRatio = (canvas.width + 50) / img.width;
    var vRatio = (canvas.height + 50) / img.height;
    var ratio = Math.min(hRatio, vRatio);
    var centerShift_x = (canvas.width - img.width * ratio) / 2;
    var centerShift_y = (canvas.height - img.height * ratio) / 2;
    ctx.drawImage(img, 0, 0, img.width, img.height,
        centerShift_x, centerShift_y, img.width * ratio, img.height * ratio);

    return {
        "centerShift_x": centerShift_x,
        "centerShift_y": centerShift_y,
        "rw": img.width * ratio,
        "rh": img.height * ratio
    }
}